import React, { Component } from 'react'
import BasePage from './BasePage';
import GenerateApplicationForm from '../components/Forms/GenerateApplicationForm/GenerateApplicationForm';
import BasePageWithCard from './BasePageWithCard';

export default class GenerateApplicaton extends Component {
  
  render() {
    const studentData = this.props.studentData
    const teacherData = this.props.teacherData
    return (
        <BasePageWithCard isAuthenticated={true} data={studentData} >
       <GenerateApplicationForm studentData={studentData} teacherData={teacherData}/>
        </BasePageWithCard>
    )
  }
}
